import { useEffect } from "react/cjs/react.production.min";
import axios from "axios";
const Example = () => {
  useEffect = () => {
    axios.get('http://localhost:3003/user').then((res) => {
      console.log(res);
    })
  }
  return <></>;
};

export default Example;
